    const handleOnClick = () => {
        setseccion(seccion+1)
    }
    return (
        <div className="row">
            <div className="col">

            </div>


            <div className= "col-12 d-flex justify-content-end mt-3">
                <button type="button" className= "btn btn-primary" onClick={handleOnClick} >Siguiente</button>
            </div>

        </div>

    )
}
